import React from "react";
import Button from "@mui/material/Button";
import HomeIcon from "@mui/icons-material/Home";

const SideBarButton = () => {
  return (
    <div>
      <Button
        variant="outline"
        sx={{
          color: "white",
        }}
        startIcon={<HomeIcon />}
      >
        Home
      </Button>
    </div>
  );
};

export default SideBarButton;
